INSERT INTO `footer_content_settings` (`id`, `terms_title`, `terms_description`, `privacy_title`, `privacy_description`, `equal_men_title`, `equal_men_description`) VALUES
(1, 'Conditions d’utilisation', '<h3>D&eacute;finitions</h3>\r\n\r\n<p>On d&eacute;signera par la suite:</p>\r\n\r\n<ul>\r\n	<li><strong>&laquo; Site &raquo;</strong>&nbsp;ou&nbsp;<strong>&laquo; Service &raquo;</strong>&nbsp;: le site et l&rsquo;ensemble de ses pages.</li>\r\n	<li><strong>&laquo; Editeur &raquo;</strong>&nbsp;: FFREELY LIBERTINAGE, personne morale ou physique responsable de l&rsquo;&eacute;dition et du contenu du Site.</li>\r\n	<li><strong>&laquo; Utilisateur &raquo;</strong>&nbsp;: l&rsquo;internaute visitant et utilisant les Services du Site.</li>\r\n</ul>\r\n\r\n<p>Les pr&eacute;sentes Conditions G&eacute;n&eacute;rales d&rsquo;Utilisation (ci-apr&egrave;s les &laquo; CGU &raquo;) sont propos&eacute;es par l&rsquo;Editeur du Site. L&rsquo;Utilisateur du Site est invit&eacute; &agrave; lire attentivement ces CGU, &agrave; les imprimer et/ou &agrave; les sauvegarder sur un support durable. L&rsquo;Utilisateur reconna&icirc;t avoir pris connaissance des CGU et les accepte int&eacute;gralement et sans r&eacute;serve.</p>\r\n\r\n<h3>Article 1 &ndash; Application des CGU</h3>\r\n\r\n<p>Les pr&eacute;sentes CGU ont pour objet de d&eacute;finir les conditions d&rsquo;acc&egrave;s au Site par les Utilisateurs. L&rsquo;Editeur se r&eacute;serve le droit de modifier &agrave; tout moment les CGU en publiant une nouvelle version de ces derni&egrave;res sur le Site.&nbsp;<strong>Les CGU applicables &agrave; l&rsquo;Utilisateur sont celles en vigueur au jour de son acceptation</strong>.</p>\r\n\r\n<p>Le Site est d&rsquo;acc&egrave;s libre et gratuit &agrave; tout Utilisateur. L&rsquo;acquisition d&rsquo;un produit ou d&rsquo;un service, ou la cr&eacute;ation d&rsquo;un espace membre, ou de mani&egrave;re plus g&eacute;n&eacute;rale la navigation sur le Site suppose l&rsquo;acceptation, par l&rsquo;Utilisateur, de l&rsquo;int&eacute;gralit&eacute; des pr&eacute;sentes CGU, qui reconna&icirc;t du m&ecirc;me fait en avoir pris pleinement connaissance.</p>\r\n\r\n<p>Cette acceptation pourra consister par exemple, pour l&rsquo;Utilisateur, &agrave; cocher la case correspondant &agrave; la phrase d&rsquo;acceptation des pr&eacute;sentes CGU, ayant par exemple la mention &laquo;&nbsp;<em>je reconnais avoir lu et accept&eacute; l&rsquo;ensemble des conditions g&eacute;n&eacute;rales du Site</em>&nbsp;&raquo;. Le fait de cocher cette case sera r&eacute;put&eacute; avoir la m&ecirc;me valeur qu&rsquo;une signature manuscrite de la part de l&rsquo;Utilisateur.</p>\r\n\r\n<p>L&rsquo;Utilisateur reconna&icirc;t la valeur de preuve des syst&egrave;mes d&rsquo;enregistrement automatique de l&rsquo;Editeur du pr&eacute;sent Site et, sauf pour lui d&rsquo;apporter une preuve contraire, il renonce &agrave; les contester en cas de litige.</p>\r\n\r\n<p>L&rsquo;acceptation des pr&eacute;sentes CGU suppose de la part des Utilisateurs qu&rsquo;ils jouissent de la capacit&eacute; juridique n&eacute;cessaire pour cela. Si l&rsquo;Utilisateur est mineur ou ne dispose pas de cette capacit&eacute; juridique, il d&eacute;clare avoir l&rsquo;autorisation d&rsquo;un tuteur, d&rsquo;un curateur ou de son repr&eacute;sentant l&eacute;gal.</p>\r\n\r\n<p>L&rsquo;Editeur met &agrave; la disposition du Client, sur son Site, une charte de confidentialit&eacute; sp&eacute;cifiant l&rsquo;ensemble des informations aff&eacute;rentes &agrave; l&rsquo;utilisation des donn&eacute;es &agrave; caract&egrave;re personnel du Client collect&eacute;es par l&rsquo;Editeur&nbsp;et aux droits dont le Client dispose vis-&agrave;-vis de ces donn&eacute;es personnelles.&nbsp;La politique de confidentialit&eacute; des donn&eacute;es fait partie des CGU. L&rsquo;acceptation des pr&eacute;sentes CGU implique par cons&eacute;quent l&rsquo;acceptation de la politique de confidentialit&eacute; des donn&eacute;es.</p>\r\n\r\n<h3>Article 2 &ndash; Mentions l&eacute;gales, donn&eacute;es personnelles et objet du Site</h3>\r\n\r\n<p>Le pr&eacute;sent Site est &eacute;dit&eacute; par FREELY LIBERTINGAGE soco&eacute;t&eacute;. Les informations l&eacute;gales concernant l&rsquo;h&eacute;bergeur et l&rsquo;Editeur du Site, notamment les coordonn&eacute;es et les &eacute;ventuelles informations de capital et d&rsquo;immatriculation, sont fournies dans les mentions l&eacute;gales du pr&eacute;sent Site.</p>\r\n\r\n<p>Les informations concernant la collecte et le traitement des donn&eacute;es personnelles (politique et d&eacute;claration) sont fournies dans la charte de donn&eacute;es personnelles du Site.</p>\r\n\r\n<p>L&rsquo;objet du pr&eacute;sent Site est d&eacute;termin&eacute; comme &laquo; Site de rencontre pour adulte &raquo;.</p>\r\n\r\n<h3>Article 3 &ndash; Espace membre</h3>\r\n\r\n<p>L&rsquo;Utilisateur inscrit au Site (membre) a la possibilit&eacute; d&rsquo;y acc&eacute;der en se connectant gr&acirc;ce &agrave; ses identifiants (adresse e-mail d&eacute;finie lors de son inscription et mot de passe) ou &eacute;ventuellement en utilisant des syst&egrave;mes tels que des boutons de connexion tiers de r&eacute;seaux sociaux. L&rsquo;utilisateur est enti&egrave;rement responsable de la protection du mot de passe qu&rsquo;il a choisi. Il est encourag&eacute; &agrave; utiliser des mots de passe complexes. En cas d&rsquo;oubli du mot de passe, l&rsquo;Utilisateur a la possibilit&eacute; d&rsquo;en g&eacute;n&eacute;rer un nouveau. Ce mot de passe constitue la garantie de la confidentialit&eacute; des informations contenues dans sa rubrique &laquo; mon compte &raquo; et l&rsquo;Utilisateur s&rsquo;interdit donc de le transmettre ou de le communiquer &agrave; un tiers. A d&eacute;faut, l&rsquo;Editeur du Site ne pourra &ecirc;tre tenu pour responsable des acc&egrave;s non autoris&eacute;s au compte d&rsquo;un Utilisateur.</p>\r\n\r\n<p>La cr&eacute;ation d&rsquo;un espace personnel est un pr&eacute;alable indispensable &agrave; toute commande ou contribution de l&rsquo;Utilisateur sur le pr&eacute;sent Site. A cette fin, l&rsquo;Utilisateur sera invit&eacute; &agrave; fournir un certain nombre d&rsquo;informations personnelles. Il s&rsquo;engage &agrave; fournir des informations exactes.</p>\r\n\r\n<p>La collecte des donn&eacute;es a pour objet la cr&eacute;ation d&rsquo;un &laquo; compte membre &raquo;. Si les donn&eacute;es contenues dans la rubrique compte membre venaient &agrave; dispara&icirc;tre &agrave; la suite d&rsquo;une panne technique ou d&rsquo;un cas de force majeure, la responsabilit&eacute; du Site et de son Editeur ne pourrait &ecirc;tre engag&eacute;e, ces informations n&rsquo;ayant aucune valeur probante mais uniquement un caract&egrave;re informatif. Les pages relatives aux comptes membres sont librement imprimables par le titulaire du compte en question mais ne constituent nullement une preuve, elles n&rsquo;ont qu&rsquo;un caract&egrave;re informatif destin&eacute; &agrave; assurer une gestion efficace du service ou des contributions par l&rsquo;Utilisateur.</p>\r\n\r\n<p>Chaque Utilisateur est libre de fermer son compte et ses donn&eacute;es sur le Site. Pour ceci, il doit adresser un e-mail &agrave; FREELY LIBERTINAGE indiquant qu&rsquo;il souhaite supprimer son compte. Aucune r&eacute;cup&eacute;ration de ses donn&eacute;es ne sera alors possible.</p>\r\n\r\n<p>L&rsquo;Editeur se r&eacute;serve le droit exclusif de supprimer le compte de tout Utilisateur qui aurait contrevenu aux pr&eacute;sentes CGU (notamment, mais sans que cet exemple n&rsquo;ait un quelconque caract&egrave;re exhaustif, lorsque l&rsquo;Utilisateur aura fourni sciemment des informations erron&eacute;es, lors de son inscription et de la constitution de son espace personnel) ou encore tout compte inactif depuis au moins une ann&eacute;e. Ladite suppression ne sera pas susceptible de constituer un dommage pour l&rsquo;Utilisateur exclu qui ne pourra pr&eacute;tendre &agrave; aucune indemnit&eacute; de ce fait. Cette exclusion n&rsquo;est pas exclusive de la possibilit&eacute;, pour l&rsquo;Editeur, d&rsquo;entreprendre des poursuites d&rsquo;ordre judiciaire &agrave; l&rsquo;encontre de l&rsquo;Utilisateur, lorsque les faits l&rsquo;auront justifi&eacute;.</p>\r\n\r\n<h3>Article 4 &ndash; Acc&egrave;s et disponibilit&eacute; du Site</h3>\r\n\r\n<p>L&rsquo;Editeur fait ses meilleurs efforts pour rendre le Site accessible en permanence, sous r&eacute;serve des op&eacute;rations de maintenance du Site ou des serveurs sur lesquels il est h&eacute;berg&eacute;. En cas d&rsquo;impossibilit&eacute; d&rsquo;acc&egrave;s au Site, en raison de probl&egrave;mes techniques ou de toutes natures, l&rsquo;Utilisateur ne pourra se pr&eacute;valoir d&rsquo;un dommage et ne pourra pr&eacute;tendre &agrave; aucune indemnit&eacute;.</p>\r\n\r\n<p>L&rsquo;Editeur du Site n&rsquo;est tenu que par une obligation de moyens ; sa responsabilit&eacute; ne pourra &ecirc;tre engag&eacute;e pour un dommage r&eacute;sultant de l&rsquo;utilisation du r&eacute;seau Internet tel que perte de donn&eacute;es, intrusion, virus, rupture du service, ou autres.</p>\r\n\r\n<p>L&rsquo;Utilisateur admet express&eacute;ment utiliser le Site &agrave; ses propres risques et sous sa responsabilit&eacute; exclusive.</p>\r\n\r\n<p>Le Site fournit &agrave; l&rsquo;Utilisateur des informations &agrave; titre indicatif, avec des imperfections, erreurs, omissions, inexactitudes et autres ambivalences susceptibles d&rsquo;exister. En tout &eacute;tat de cause, FREELY LUBERTINAGE ne pourra en aucun cas &ecirc;tre tenu responsable :</p>\r\n\r\n<ul>\r\n	<li>de tout dommage direct ou indirect, notamment en ce qui concerne les pertes de profits, le manque &agrave; gagner, les pertes de client&egrave;le, de donn&eacute;es pouvant entre autres r&eacute;sulter de l&rsquo;utilisation du Site, ou au contraire de l&rsquo;impossibilit&eacute; de son utilisation ;</li>\r\n	<li>d&rsquo;un dysfonctionnement, d&rsquo;une indisponibilit&eacute; d&rsquo;acc&egrave;s, d&rsquo;une mauvaise utilisation, d&rsquo;une mauvaise configuration de l&rsquo;ordinateur de l&rsquo;Utilisateur, ou encore de l&rsquo;emploi d&rsquo;un navigateur peu usit&eacute; par l&rsquo;Utilisateur.</li>\r\n</ul>\r\n\r\n<h3>Article 5 &ndash; Liens hypertextes</h3>\r\n\r\n<p>Le Site peut inclure des liens hypertextes vers d&rsquo;autres sites.</p>\r\n\r\n<p>L&rsquo;Utilisateur reconna&icirc;t par cons&eacute;quent que l&rsquo;Editeur ne pourra &ecirc;tre tenu responsable de tous dommages ou pertes av&eacute;r&eacute;s ou all&eacute;gu&eacute;s, cons&eacute;cutifs &agrave; ou en relation avec l&rsquo;utilisation ou avec le fait d&rsquo;avoir pris connaissance des contenus, publicit&eacute;s, produits ou services disponibles sur ces sites ou sources externes. De m&ecirc;me, la responsabilit&eacute; de l&rsquo;Editeur du pr&eacute;sent Site ne saurait &ecirc;tre engag&eacute;e si la visite, par l&rsquo;Utilisateur, de l&rsquo;un de ces sites, lui causait un pr&eacute;judice.</p>\r\n\r\n<p>Si, en d&eacute;pit des efforts de l&rsquo;Editeur, un des liens hypertextes pr&eacute;sents sur le Site pointait vers un site ou une source internet dont le contenu &eacute;tait ou paraissait non conforme aux exigences de la loi fran&ccedil;aise &agrave; un Utilisateur, celui-ci s&rsquo;engage &agrave; prendre imm&eacute;diatement contact avec le directeur de la publication du Site, dont les coordonn&eacute;es figurent dans les mentions l&eacute;gales du Site, afin de lui communiquer l&rsquo;adresse des pages du site tiers en cause.</p>\r\n\r\n<h3>Article 6 &ndash; Cookies</h3>\r\n\r\n<p>Un &laquo; Cookie &raquo; peut permettre l&rsquo;identification de l&rsquo;Utilisateur du Site, la personnalisation de sa consultation du Site et l&rsquo;acc&eacute;l&eacute;ration de l&rsquo;affichage du Site gr&acirc;ce &agrave; l&rsquo;enregistrement d&rsquo;un fichier de donn&eacute;es sur son ordinateur. Le Site est susceptible d&rsquo;utiliser des &laquo; Cookies &raquo; principalement pour 1) obtenir des statistiques de navigation afin d&rsquo;am&eacute;liorer l&rsquo;exp&eacute;rience de l&rsquo;Utilisateur, et 2) permettre l&rsquo;acc&egrave;s &agrave; un compte de membre et &agrave; du contenu qui n&rsquo;est pas accessible sans connexion.</p>\r\n\r\n<p>L&rsquo;Utilisateur reconna&icirc;t &ecirc;tre inform&eacute; de cette pratique et autorise l&rsquo;Editeur du Site &agrave; y recourir. L&rsquo;Editeur s&rsquo;engage &agrave; ne jamais communiquer le contenu de ces &laquo; Cookies &raquo; &agrave; des tierces personnes, sauf en cas de r&eacute;quisition l&eacute;gale.</p>\r\n\r\n<p>L&rsquo;Utilisateur peut refuser l&rsquo;enregistrement de &laquo; Cookies &raquo; ou configurer son navigateur pour &ecirc;tre pr&eacute;venu pr&eacute;alablement &agrave; l&rsquo;acception les &laquo; Cookies &raquo;. Pour ce faire, l&rsquo;Utilisateur proc&eacute;dera au param&eacute;trage de son navigateur :</p>\r\n\r\n<ul>\r\n	<li>Pour Internet Explorer :&nbsp;<a href=\"http://windows.microsoft.com/fr-FR/windows-vista/Block-or-allow-cookies\" target=\"_blank\">http://windows.microsoft.com/fr-FR/windows-vista/Block-or-allow-cookies</a></li>\r\n	<li>Pour Safari :&nbsp;<a href=\"https://support.apple.com/fr-fr/ht1677\" target=\"_blank\">https://support.apple.com/fr-fr/ht1677</a></li>\r\n	<li>Pour Google Chrome :&nbsp;<a href=\"https://support.google.com/chrome/answer/95647?hl=fr&amp;hlrm=en&amp;safe=on\" target=\"_blank\">https://support.google.com/chrome/answer/95647?hl=fr&amp;hlrm=en&amp;safe=on</a></li>\r\n	<li>Pour Firefox :&nbsp;<a href=\"https://support.mozilla.org/fr/kb/activer-desactiver-cookies\" target=\"_blank\">https://support.mozilla.org/fr/kb/activer-desactiver-cookies</a></li>\r\n	<li>Pour Opera :&nbsp;<a href=\"http://help.opera.com/Windows/10.20/fr/cookies.html\" target=\"_blank\">http://help.opera.com/Windows/10.20/fr/cookies.html</a></li>\r\n</ul>\r\n\r\n<h3>Article 7 &ndash; Droits de propri&eacute;t&eacute; intellectuelle</h3>\r\n\r\n<p>Tous les &eacute;l&eacute;ments du pr&eacute;sent Site appartiennent &agrave; l&rsquo;Editeur ou &agrave; un tiers mandataire, ou sont utilis&eacute;s par l&rsquo;Editeur sur le Site avec l&rsquo;autorisation de leur propri&eacute;taire.</p>\r\n\r\n<p><strong>Toute repr&eacute;sentation, reproduction ou adaptation des logos, contenus textuels, pictographiques ou vid&eacute;os, sans que cette &eacute;num&eacute;ration ne soit limitative, est rigoureusement interdite et s&rsquo;apparente &agrave; de la contrefa&ccedil;on</strong>.</p>\r\n\r\n<p>Tout Utilisateur qui se rendrait coupable de contrefa&ccedil;on serait susceptible de voir son acc&egrave;s au site supprim&eacute; sans pr&eacute;avis ni indemnit&eacute; et sans que cette exclusion ne puisse lui &ecirc;tre constitutive d&rsquo;un dommage, sans r&eacute;serve d&rsquo;&eacute;ventuelles poursuites judiciaires ult&eacute;rieures &agrave; son encontre, &agrave; l&rsquo;initiative de l&rsquo;Editeur du pr&eacute;sent Site ou de son mandataire.</p>\r\n\r\n<p>Les marques et logos contenus dans le Site sont susceptibles d&rsquo;&ecirc;tre d&eacute;pos&eacute;s par FREELY LIBERTINAGE, ou &eacute;ventuellement par un de ses partenaires. Toute personne proc&eacute;dant &agrave; leurs repr&eacute;sentations, reproductions, imbrications, diffusions et rediffusions encourt les sanctions pr&eacute;vues aux articles L.713-2 et suivants du Code de la propri&eacute;t&eacute; intellectuelle.</p>\r\n\r\n<h3>Article 8 &ndash; Responsabilit&eacute;</h3>\r\n\r\n<p>L&rsquo;Editeur n&rsquo;est pas responsable des publications des Utilisateurs, de leur contenu ainsi que de leur v&eacute;racit&eacute;. L&rsquo;Editeur ne peut en aucun cas &ecirc;tre tenu responsable de tout dommage susceptible d&rsquo;intervenir sur le syst&egrave;me informatique de l&rsquo;Utilisateur et/ou de la perte de donn&eacute;es r&eacute;sultant de l&rsquo;utilisation du Site par l&rsquo;Utilisateur.</p>\r\n\r\n<p>L&rsquo;Editeur s&rsquo;engage &agrave; constamment mettre &agrave; jour le contenu du Site et &agrave; fournir aux Utilisateurs des informations justes, claires, pr&eacute;cises et r&eacute;actualis&eacute;es. Le Site est en principe accessible en permanence, sauf pendant les op&eacute;rations techniques de maintenance et de mise &agrave; jour du contenu. L&rsquo;Editeur ne saurait &ecirc;tre tenu responsable de dommages r&eacute;sultant de l&rsquo;indisponibilit&eacute; du Site ou de parties de celui-ci.</p>\r\n\r\n<p>La responsabilit&eacute; de l&rsquo;Editeur du Site ne peut &ecirc;tre engag&eacute;e en raison d&rsquo;une indisponibilit&eacute; technique de la connexion, qu&rsquo;elle soit due notamment &agrave; un cas de force majeure, &agrave; une maintenance, &agrave; une mise &agrave; jour, &agrave; une modification du Site, &agrave; une intervention de l&rsquo;h&eacute;bergeur, &agrave; une gr&egrave;ve interne ou externe, &agrave; une panne de r&eacute;seau, ou encore &agrave; une coupure d&rsquo;alimentation &eacute;lectrique.</p>\r\n\r\n<p>L&rsquo;Editeur ne saurait &ecirc;tre tenu responsable du non fonctionnement, d&rsquo;une impossibilit&eacute; d&rsquo;acc&egrave;s ou de dysfonctionnements du Site imputables &agrave; un &eacute;quipement non adapt&eacute;, &agrave; une mauvais configuration ou utilisation de l&rsquo;ordinateur de l&rsquo;Utilisateur, &agrave; des dysfonctionnements des services du fournisseur d&rsquo;acc&egrave;s des Utilisateurs, ou &agrave; ceux du r&eacute;seau internet.</p>\r\n\r\n<h3>Article 9 &ndash; Contribution des Utilisateurs au contenu du Site</h3>\r\n\r\n<p>Les Utilisateurs se voient offrir la facult&eacute; de contribuer au contenu du pr&eacute;sent Site. Les Utilisateurs sont inform&eacute;s que l&rsquo;Editeur du Site, repr&eacute;sent&eacute; le cas &eacute;ch&eacute;ant par les mod&eacute;rateurs, peut choisir de publier le contenu en question sur les newsletters de ce Site et sur les sites de tous ses partenaires, &agrave; charge pour l&rsquo;Editeur de citer le pseudonyme de l&rsquo;auteur de la contribution.</p>\r\n\r\n<p>L&rsquo;auteur renonce donc &agrave; ses droits sur le contenu des contributions, au profit de l&rsquo;Editeur du Site, pour toute diffusion ou utilisation, m&ecirc;me commerciale, sur le support internet, ceci, bien &eacute;videmment, toujours dans le respect de la paternit&eacute; de l&rsquo;auteur.</p>\r\n\r\n<h3>Article 10 &ndash; Notifications et r&eacute;clamations</h3>\r\n\r\n<p>Toute notification ou avis concernant les pr&eacute;sentes CGU, les mentions l&eacute;gales ou la charte de donn&eacute;es personnelles doit &ecirc;tre faite par &eacute;crit et envoy&eacute;e par courrier recommand&eacute; ou certifi&eacute;, ou par mail &agrave; l&rsquo;adresse indiqu&eacute;e dans les mentions l&eacute;gales du Site, en pr&eacute;cisant les coordonn&eacute;es, nom et pr&eacute;nom du notifiant, ainsi que l&rsquo;objet de l&rsquo;avis.</p>\r\n\r\n<p>Toute r&eacute;clamation li&eacute;e &agrave; l&rsquo;utilisation du Site, des Services, des pages du Site sur des r&eacute;seaux sociaux &eacute;ventuels ou aux CGU, aux mentions l&eacute;gales ou &agrave; la charte de donn&eacute;es personnelles doit &ecirc;tre d&eacute;pos&eacute;e dans les 365 jours suivant le jour d&rsquo;origine du probl&egrave;me source de r&eacute;clamation, et ce ind&eacute;pendamment de toute loi ou r&egrave;gle de droit contraire. Dans le cas o&ugrave; une telle r&eacute;clamation n&rsquo;aurait pas &eacute;t&eacute; d&eacute;pos&eacute;e dans les 365 jours suivants, une telle r&eacute;clamation sera &agrave; jamais inapplicable en justice.</p>\r\n\r\n<p>Il peut &ecirc;tre possible que se trouvent, dans l&rsquo;ensemble du Site internet et des Services propos&eacute;s, et dans une mesure restreinte, des inexactitudes ou des erreurs, ou des informations qui soient en d&eacute;saccord avec les CGU, les mentions l&eacute;gales ou la charte de donn&eacute;es personnelles. En outre, il est possible que des modifications non autoris&eacute;es soient faites par des tiers sur le Site ou sur des Services annexes (r&eacute;seaux sociaux&hellip;).</p>\r\n\r\n<p>Dans une telle situation, l&rsquo;Utilisateur a la possibilit&eacute; de contacter l&rsquo;Editeur du Site par courrier postal ou par mail aux adresses indiqu&eacute;es dans les mentions l&eacute;gales du Site, avec si possible une description de l&rsquo;erreur et l&rsquo;emplacement (URL), ainsi que des informations suffisantes permettant de le contacter.</p>\r\n\r\n<h3>Article 11 &ndash; Ind&eacute;pendance des clauses</h3>\r\n\r\n<p>Si une disposition des CGU est jug&eacute;e ill&eacute;gale, nulle ou pour toute autre raison inapplicable, alors cette disposition sera r&eacute;put&eacute;e divisible des CGU et n&rsquo;affectera pas la validit&eacute; et l&rsquo;applicabilit&eacute; des dispositions restantes.</p>\r\n\r\n<p>Les CGU remplacent tous accords ant&eacute;rieurs ou contemporains &eacute;crits ou oraux. Elles ne sont pas cessibles, transf&eacute;rables ou sous-licenciables par l&rsquo;Utilisateur lui-m&ecirc;me.</p>\r\n\r\n<p>Une version imprim&eacute;e des CGU et de tous les avis donn&eacute;s sous forme &eacute;lectronique pourra &ecirc;tre demand&eacute;e dans des proc&eacute;dures judiciaires ou administratives en rapport avec les CGU. Les parties conviennent que toute la correspondance relative &agrave; ces CGU doit &ecirc;tre r&eacute;dig&eacute;e dans la langue fran&ccedil;aise.</p>\r\n\r\n<h3>Article 12 &ndash; Loi applicable</h3>\r\n\r\n<p>Les pr&eacute;sentes CGU sont r&eacute;gies par et soumises au droit Fran&ccedil;ais.</p>\r\n\r\n<p>Sauf dispositions d&rsquo;ordre public, tous litiges qui pourraient survenir dans le cadre de l&rsquo;ex&eacute;cution des pr&eacute;sentes CGU pourront avant toute action judiciaire &ecirc;tre soumis &agrave; l&rsquo;appr&eacute;ciation de l&rsquo;Editeur du Site en vue d&rsquo;un r&egrave;glement amiable.</p>\r\n\r\n<p>Il est express&eacute;ment rappel&eacute; que les demandes de r&egrave;glement amiable ne suspendent pas les d&eacute;lais ouverts pour intenter les actions judiciaires.</p>\r\n\r\n<p>Sauf disposition contraire, d&rsquo;ordre public, toute action judiciaire relative &agrave; l&rsquo;ex&eacute;cution des pr&eacute;sentes CGU devra &ecirc;tre soumise &agrave; la comp&eacute;tence des juridictions du ressort du lieu du domicile du d&eacute;fendeur.</p>\r\n\r\n<p>Tous droits r&eacute;serv&eacute;s &ndash; 11 mai 2021</p>', 'POLITIQUE DE CONFIDENTIALITÉ ET D’UTILISATION DES DONNÉES PERSONNELLES', '<h3>D&eacute;finition des termes utilis&eacute;s dans la politique de confidentialit&eacute;</h3>\r\n\r\n<p>On d&eacute;signera par la suite :</p>\r\n\r\n<ul>\r\n	<li><strong>&laquo; Donn&eacute;e personnelle &raquo;&nbsp;</strong>: se d&eacute;finit comme &laquo;&nbsp;<em>toute information relative &agrave; une personne physique identifi&eacute;e ou qui peut &ecirc;tre identifi&eacute;e, directement ou indirectement, par r&eacute;f&eacute;rence &agrave; un num&eacute;ro d&rsquo;identification ou &agrave; un ou plusieurs &eacute;l&eacute;ments qui lui sont propres</em>&nbsp;&raquo;, conform&eacute;ment &agrave; la loi Informatique et libert&eacute;s du 6 janvier 1978.</li>\r\n	<li><strong>&laquo; Service &raquo;</strong>&nbsp;: le service et l&rsquo;ensemble de ses contenus.</li>\r\n	<li><strong>&laquo; &Eacute;diteur &raquo;</strong>&nbsp;ou&nbsp;<strong>&laquo; Nous &raquo;</strong>&nbsp;: FREELY LIBERTINAGE, personne morale ou physique responsable de l&rsquo;&eacute;dition et du contenu du Service.</li>\r\n	<li><strong>&laquo; Utilisateur &raquo;&nbsp;</strong>ou&nbsp;<strong>&laquo; Vous &raquo;</strong>&nbsp;: l&rsquo;internaute visitant et utilisant le Service.</li>\r\n</ul>\r\n\r\n<h3>Article 1 &ndash; Introduction et r&ocirc;le de la Politique de confidentialit&eacute;</h3>\r\n\r\n<p>La pr&eacute;sente charte vise &agrave; vous informer des engagements du Service eu &eacute;gard au respect de votre vie priv&eacute;e et &agrave; la protection des Donn&eacute;es personnelles vous concernant, collect&eacute;es et trait&eacute;es &agrave; l&rsquo;occasion de votre utilisation du Service.</p>\r\n\r\n<p>Il est important que vous lisiez la pr&eacute;sente politique de confidentialit&eacute; afin que vous soyez conscient des raisons pour lesquelles nous utilisons vos donn&eacute;es et comment nous le faisons.</p>\r\n\r\n<p>En vous inscrivant sur le Service, vous vous engagez &agrave; nous fournir des informations v&eacute;ritables vous concernant. La communication de fausses informations est contraire aux conditions g&eacute;n&eacute;rales figurant sur le Service.</p>\r\n\r\n<p>Veuillez noter que la pr&eacute;sente Politique de confidentialit&eacute; est susceptible d&rsquo;&ecirc;tre modifi&eacute;e ou compl&eacute;t&eacute;e &agrave; tout moment, notamment en vue de se conformer &agrave; toute &eacute;volution l&eacute;gislative, r&eacute;glementaire, jurisprudentielle ou technologique. La date de sa mise &agrave; jour sera clairement mentionn&eacute;e, le cas &eacute;ch&eacute;ant.</p>\r\n\r\n<p>Ces modifications vous engagent d&egrave;s leur mise en ligne et nous vous invitons donc &agrave; consulter r&eacute;guli&egrave;rement la pr&eacute;sente Politique de confidentialit&eacute; afin de prendre connaissance des &eacute;ventuelles modifications.</p>\r\n\r\n<p>Vous trouverez &eacute;galement la description de vos droits &agrave; la protection de la vie priv&eacute;e et la fa&ccedil;on dont la loi vous prot&egrave;ge.</p>\r\n\r\n<p>Si vous avez des questions concernant la pr&eacute;sente politique de confidentialit&eacute; ou si vous voulez exercer vos droits tels que d&eacute;crit &agrave; l&rsquo;article 10 de la pr&eacute;sente Politique de confidentialit&eacute;, veuillez nous contacter par e-mail &agrave; l&rsquo;adresse :&nbsp;<a href=\"mailto:freelycontact30@gmail.com\" target=\"_blank\">freelycontact30@gmail.com</a>&nbsp;ou par courrier adress&eacute; &agrave; : 6 chemin combe de tourelle 30111 Cong&eacute;nies.</p>\r\n\r\n<h3>Article 2 &ndash; Donn&eacute;es collect&eacute;es sur le Site</h3>\r\n\r\n<p>Les Donn&eacute;es collect&eacute;es et ult&eacute;rieurement trait&eacute;es par le Service sont celles que vous nous transmettez volontairement en remplissant les diff&eacute;rents formulaires pr&eacute;sents au sein du Service. Pour certaines op&eacute;rations sur les contenus, vous pourrez &ecirc;tre amen&eacute;s &agrave; transmettre des Donn&eacute;es vous concernant &agrave; des tiers partenaires au travers de leurs propres services, plus sp&eacute;cifiquement lors des paiements que vous pourrez effectuer. Nous ne disposerons pas des dites donn&eacute;es, leur collecte et leur traitement &eacute;tant r&eacute;gis par les conditions propres &agrave; ces intervenants. Nous vous invitons &agrave; consulter leurs conditions avant de communiquer vos Donn&eacute;es dans ce cadre.</p>\r\n\r\n<p>Votre adresse IP (num&eacute;ro d&rsquo;identification attribu&eacute; sur Internet &agrave; votre ordinateur) est collect&eacute;e automatiquement. Vous &ecirc;tes inform&eacute;s que le Service est susceptible de mettre en &oelig;uvre un proc&eacute;d&eacute; automatique de tra&ccedil;age (Cookie), auquel vous pouvez faire obstacle en modifiant les param&egrave;tres concern&eacute;s de votre navigateur internet, comme expliqu&eacute; dans les conditions g&eacute;n&eacute;rales du pr&eacute;sent Service.</p>\r\n\r\n<p>D&rsquo;une mani&egrave;re g&eacute;n&eacute;rale, il vous est possible de visiter le Service sans communiquer aucune information personnelle vous concernant. Dans tous les cas, vous n&rsquo;avez aucune obligation de transmettre ces informations. N&eacute;anmoins, en cas de refus, il se peut que vous ne puissiez pas b&eacute;n&eacute;ficier de certaines informations ou services.</p>\r\n\r\n<p>Nous recueillons, utilisons et partageons &eacute;galement des donn&eacute;es agr&eacute;g&eacute;es telles que des donn&eacute;es statistiques ou d&eacute;mographiques quel qu&rsquo;en soit l&rsquo;usage. Les donn&eacute;es agr&eacute;g&eacute;es peuvent provenir de vos informations personnelles mais ne sont pas concern&eacute;es comme telles par la loi car ces donn&eacute;es ne r&eacute;v&egrave;lent pas directement votre identit&eacute;. Par exemple, nous pouvons agr&eacute;ger vos donn&eacute;es d&rsquo;utilisation afin de calculer le pourcentage d&rsquo;utilisateurs qui acc&egrave;dent &agrave; une fonctionnalit&eacute; sp&eacute;cifique du Service.</p>\r\n\r\n<p>Aux fins de fournir de meilleurs contenus et services, le Service utilise le service d&rsquo;analyse de Google Analytics. Google Analytics ne suit pas vos habitudes de navigation sur des services tiers. Les informations vous concernant auxquelles Google Analytics a acc&egrave;s ne contiennent aucune donn&eacute;e personnelle vous concernant.</p>\r\n\r\n<p>Nous ne collectons pas de donn&eacute;es dites &laquo; sensibles &raquo;.</p>\r\n\r\n<p>Les coordonn&eacute;es des Utilisateurs du Service qui se seront inscrits sur celui-ci seront sauvegard&eacute;es, dans le respect des dispositions de la loi informatique et libert&eacute; du 6 janvier 1978. Conform&eacute;ment &agrave; cette derni&egrave;re, ils disposent d&rsquo;un droit d&rsquo;acc&egrave;s, de retrait, de modification ou de rectification des Donn&eacute;es qu&rsquo;ils ont fournies. Pour cela, il leur suffit d&rsquo;en faire la demande &agrave; l&rsquo;adresse &eacute;lectronique suivante :&nbsp;<a href=\"mailto:freelycontact30@gmail.com\" target=\"_blank\">freelycontact30@gmail.com</a>, ou par courrier : 6 chemin combe de tourelle 30111 Cong&eacute;nies.</p>\r\n\r\n<p>La collecte des Donn&eacute;es personnelles des Utilisateurs par l&rsquo;Editeur ne n&eacute;cessite pas de d&eacute;claration aupr&egrave;s de l&rsquo;autorit&eacute; fran&ccedil;aise de protection des Donn&eacute;es personnelles (la Commission Nationale de l&rsquo;Informatique et des Libert&eacute;s &ndash; CNIL).</p>\r\n\r\n<h3>Article 3 &ndash; Identit&eacute; du responsable du traitement</h3>\r\n\r\n<p>Le responsable du traitement est la soci&eacute;t&eacute; FREELY LIBERTINAGE, ayant son si&egrave;ge social &agrave; l&rsquo;adresse suivante : 6 chemin combe de tourelle, 30111 congenies .</p>\r\n\r\n<h3>Article 4 &ndash; Finalit&eacute; des Donn&eacute;es collect&eacute;es</h3>\r\n\r\n<p>Les Donn&eacute;es identifi&eacute;es comme &eacute;tant obligatoires sur les formulaires du Service sont n&eacute;cessaires afin de pouvoir b&eacute;n&eacute;ficier des fonctionnalit&eacute;s correspondantes du Service, et plus sp&eacute;cifiquement des op&eacute;rations sur les contenus propos&eacute;s au sein de celui-ci.</p>\r\n\r\n<p>Le Service est susceptible de collecter et traiter les Donn&eacute;es de ses Utilisateurs :</p>\r\n\r\n<ul>\r\n	<li>Aux fins de recueillir des informations nous permettant d&rsquo;am&eacute;liorer notre Service, nos produits et fonctionnalit&eacute;s (notamment par l&rsquo;usage des cookies).</li>\r\n</ul>\r\n\r\n<h3>Article 5 &ndash; Destinataires et utilisation des Donn&eacute;es collect&eacute;es</h3>\r\n\r\n<p>Les Donn&eacute;es collect&eacute;es par nos soins sont trait&eacute;es pour les besoins d&rsquo;ex&eacute;cution des op&eacute;rations sur les contenus du Service.</p>\r\n\r\n<p>Vous &ecirc;tes susceptible de recevoir des courriers &eacute;lectroniques (emails) de notre Service, notamment dans le cadre de newsletters que vous avez accept&eacute;es. Vous pouvez demander &agrave; ne plus recevoir ces courriers &eacute;lectroniques en nous contactant &agrave; l&rsquo;adresse&nbsp;<a href=\"mailto:freelycontact30@gmail.com\" target=\"_blank\">freelycontact30@gmail.com</a>&nbsp;ou sur le lien pr&eacute;vu &agrave; cet effet dans chacun des courriers &eacute;lectroniques qui vous seront adress&eacute;s.</p>\r\n\r\n<p>Seul FREELY LIBERTINAGE est destinataire de vos Informations personnelles. Celles-ci ne sont jamais transmises &agrave; un tiers, nonobstant les sous-traitants auxquels FREELY LIBERTINAGE fait appel. Ni FREELY LIBERTINAGE ni ses sous-traitants ne proc&egrave;dent &agrave; la commercialisation des donn&eacute;es personnelles des visiteurs et utilisateurs de son Service.</p>\r\n\r\n<p>Vos donn&eacute;es personnelles peuvent &ecirc;tre partag&eacute;es avec les parties indiqu&eacute;es ci-dessous aux fins d&eacute;finies dans la pr&eacute;sente politique de confidentialit&eacute;.</p>\r\n\r\n<p>Nous exigeons que tous les tiers garantissent la s&eacute;curit&eacute; de vos donn&eacute;es personnelles et les traitent conform&eacute;ment &agrave; la loi. Nous ne permettons pas &agrave; nos fournisseurs de services tiers d&rsquo;utiliser vos donn&eacute;es.</p>\r\n\r\n<h3>Article 6 &ndash; Fondements l&eacute;gaux r&eacute;gissant le traitement des donn&eacute;es</h3>\r\n\r\n<p>Conform&eacute;ment au R&egrave;glement G&eacute;n&eacute;ral sur la Protection des Donn&eacute;es (RGPD), FREELY LIBERTINAGE ne traite des donn&eacute;es &agrave; caract&egrave;re personnel que dans les situations suivantes :</p>\r\n\r\n<ul>\r\n	<li>avec votre&nbsp;<strong>consentement</strong>&nbsp;;</li>\r\n	<li>lorsqu&rsquo;il existe une&nbsp;<strong>obligation contractuelle</strong>&nbsp;(un contrat entre FREELY LIBERTINAGE et vous) ;</li>\r\n	<li>pour r&eacute;pondre &agrave; une&nbsp;<strong>obligation l&eacute;gale&nbsp;</strong>(en vertu de la l&eacute;gislation UE ou nationale).</li>\r\n</ul>\r\n\r\n<h3>Article 7 &ndash; S&eacute;curit&eacute; des Donn&eacute;es</h3>\r\n\r\n<p>Vous &ecirc;tes inform&eacute;s que vos Donn&eacute;es pourront &ecirc;tre divulgu&eacute;es en application d&rsquo;une loi, d&rsquo;un r&egrave;glement ou en vertu d&rsquo;une d&eacute;cision d&rsquo;une autorit&eacute; r&eacute;glementaire ou judiciaire comp&eacute;tente ou encore, si cela s&rsquo;av&egrave;re n&eacute;cessaire, aux fins, pour l&rsquo;Editeur, de pr&eacute;server ses droits et int&eacute;r&ecirc;ts.<br />\r\n<br />\r\nNous avons mis en place des mesures de s&eacute;curit&eacute; appropri&eacute;es afin d&rsquo;emp&ecirc;cher que vos donn&eacute;es personnelles ne soient accidentellement perdues, utilis&eacute;es, modifi&eacute;es, d&eacute;voil&eacute;es ou consult&eacute;es sans autorisation. De plus, l&rsquo;acc&egrave;s &agrave; vos donn&eacute;es personnelles est soumis &agrave; une proc&eacute;dure de s&eacute;curit&eacute; d&eacute;finie et document&eacute;e.</p>\r\n\r\n<h3>Article 8 &ndash; Dur&eacute;e de conservation des Donn&eacute;es</h3>\r\n\r\n<p>Les Donn&eacute;es sont stock&eacute;es chez l&rsquo;h&eacute;bergeur du Service, dont les coordonn&eacute;es figurent dans les mentions l&eacute;gales du Service, et sont conserv&eacute;es pour la dur&eacute;e strictement n&eacute;cessaire &agrave; la r&eacute;alisation des finalit&eacute;s vis&eacute;es ci-avant et ne saurait exc&eacute;der 24 mois. Au-del&agrave; de cette dur&eacute;e, elles seront conserv&eacute;es &agrave; des fins exclusivement statistiques et ne donneront lieu &agrave; aucune exploitation, de quelque nature que ce soit.</p>\r\n\r\n<h3>Article 9 &ndash; Prestataires habilit&eacute;s et transfert vers un pays tiers de l&rsquo;Union Europ&eacute;enne</h3>\r\n\r\n<p>FREELY LIBERTINAGE vous informe qu&rsquo;il a recours &agrave; des prestataires habilit&eacute;s pour faciliter le recueil et le traitement des donn&eacute;es que vous nous avez communiqu&eacute;es. Ces prestataires sont situ&eacute;s dans l&rsquo;Union Europ&eacute;enne exclusivement.</p>\r\n\r\n<p>FREELY LIBERTINAGE s&rsquo;est pr&eacute;alablement assur&eacute; de la mise en &oelig;uvre par ses prestataires de garanties ad&eacute;quates et du respect de conditions strictes en mati&egrave;re de confidentialit&eacute;, d&rsquo;usage et de protection des donn&eacute;es. Ces prestataires sont &eacute;galement soumis au R&egrave;glement G&eacute;n&eacute;ral sur la Protection des Donn&eacute;es (RGPD).</p>\r\n\r\n<h3>Article 10 &ndash; Droits informatiques et libert&eacute;s</h3>\r\n\r\n<p>Conform&eacute;ment &agrave; la l&eacute;gislation sur la protection des donn&eacute;es personnelles, vous avez les droits d&eacute;taill&eacute;s ci-apr&egrave;s que vous pouvez exercer, comme indiqu&eacute; &agrave; l&rsquo;Article 1 de la Pr&eacute;sente Politique de confidentialit&eacute; en nous &eacute;crivant &agrave; l&rsquo;adresse postale mentionn&eacute;e en t&ecirc;te (6 chemin combe de tourelle 30111 Cong&eacute;nies) ou en envoyant un courriel &agrave;&nbsp;<a href=\"mailto:freelycontact30@gmail.com\" target=\"_blank\">freelycontact30@gmail.com</a>&nbsp;:</p>\r\n\r\n<ul>\r\n	<li>Le droit d&rsquo;information : nous avons l&rsquo;obligation de vous informer de la mani&egrave;re dont nous utilisons vos donn&eacute;es personnelles (tel que d&eacute;crit dans la pr&eacute;sente politique de confidentialit&eacute;).</li>\r\n	<li>Le droit d&rsquo;acc&egrave;s : c&rsquo;est votre droit d&rsquo;effectuer une demande d&rsquo;acc&egrave;s aux donn&eacute;es vous concernant afin de recevoir une copie des donn&eacute;es &agrave; caract&egrave;re personnel que nous d&eacute;tenons ; Toutefois, en raison de l&rsquo;obligation de s&eacute;curit&eacute; et de confidentialit&eacute; dans le traitement des donn&eacute;es &agrave; caract&egrave;re personnel qui incombe &agrave; FREELY LIBERTINAGE, vous &ecirc;tes inform&eacute; que votre demande sera trait&eacute;e sous r&eacute;serve que vous rapportiez la preuve de votre identit&eacute;, notamment par la production d&rsquo;un scan ou d&rsquo;une photocopie de votre titre d&rsquo;identit&eacute; valide.</li>\r\n	<li>Le droit de rectification : le droit de nous demander de rectifier des donn&eacute;es personnelles vous concernant qui seraient incompl&egrave;tes ou inexactes. Au titre de ce droit, la l&eacute;gislation vous autorise &agrave; demander la rectification, la mise &agrave; jour, le verrouillage ou encore l&rsquo;effacement des donn&eacute;es vous concernant qui peuvent &ecirc;tre inexactes, erron&eacute;es, incompl&egrave;tes ou obsol&egrave;tes.</li>\r\n	<li>Le droit &agrave; l&rsquo;effacement, aussi connu sous le nom de &laquo; droit &agrave; l&rsquo;oubli &raquo; : dans certains cas, vous pouvez nous demander de supprimer les donn&eacute;es personnelles que nous avons vous concernant (mis &agrave; part s&rsquo;il existe une raison juridique imp&eacute;rieuse qui nous oblige &agrave; les conserver).</li>\r\n	<li>Le droit &agrave; la limitation du traitement : vous avez le droit dans certains cas de nous demander de suspendre le traitement des donn&eacute;es personnelles,</li>\r\n	<li>Le droit &agrave; la portabilit&eacute; des donn&eacute;es : vous avez le droit de nous demander une copie de vos donn&eacute;es personnelles dans un format courant (par exemple un fichier .csv).</li>\r\n	<li>Le droit d&rsquo;opposition : vous avez le droit de vous opposer au traitement de vos donn&eacute;es personnelles (par exemple, en nous interdisant de traiter vos donn&eacute;es &agrave; des fins de marketing direct).</li>\r\n</ul>\r\n\r\n<p>Cependant, l&rsquo;exercice de ce droit n&rsquo;est possible que dans l&rsquo;une des deux situations suivantes : lorsque l&rsquo;exercice de ce droit est fond&eacute; sur des motifs l&eacute;gitimes ou lorsque l&rsquo;exercice de ce droit vise &agrave; faire obstacle &agrave; ce que les donn&eacute;es recueillies soient utilis&eacute;es &agrave; des fins de prospection commerciale.</p>\r\n\r\n<p>Contactez-nous si vous souhaitez exercer l&rsquo;un des droits d&eacute;crits ci-dessus en nous &eacute;crivant &agrave; 6 chemin combe de tourelle 30111 Cong&eacute;nies ou par courriel &agrave;&nbsp;<a href=\"mailto:freelycontact30@gmail.com\" target=\"_blank\">freelycontact30@gmail.com</a></p>\r\n\r\n<p>Vous n&rsquo;aurez pas de frais &agrave; payer pour l&rsquo;acc&egrave;s &agrave; vos donn&eacute;es personnelles (ni pour l&rsquo;exercice de tout autre droit). Cependant, nous pourrons vous facturer des frais raisonnables si votre demande est manifestement infond&eacute;e, r&eacute;p&eacute;titive ou excessive. Dans ce cas, nous pouvons aussi refuser de r&eacute;pondre &agrave; votre demande.</p>\r\n\r\n<p>FFREELY LIBERTINAGE sera en droit, le cas &eacute;ch&eacute;ant, de s&rsquo;opposer aux demandes manifestement abusives de par leur caract&egrave;re syst&eacute;matique, r&eacute;p&eacute;titif, ou leur nombre.</p>\r\n\r\n<p>Nous pouvons vous demander des informations sp&eacute;cifiques afin de confirmer votre identit&eacute; et d&rsquo;assurer votre droit d&rsquo;acc&egrave;s &agrave; vos donn&eacute;es personnelles (ou pour exercer tout autre droit). Il s&rsquo;agit d&rsquo;une mesure de s&eacute;curit&eacute; pour garantir que ces donn&eacute;es personnelles ne soient pas d&eacute;livr&eacute;es &agrave; une personne non autoris&eacute;e &agrave; les recevoir. Nous pouvons aussi vous contacter pour obtenir plus d&rsquo;informations concernant votre demande, afin de vous donner une r&eacute;ponse plus rapide.</p>\r\n\r\n<p>Nous essayons de r&eacute;pondre &agrave; toutes les demandes l&eacute;gitimes dans un d&eacute;lai d&rsquo;un mois. Ce d&eacute;lai d&rsquo;un mois peut &ecirc;tre d&eacute;pass&eacute; dans le cas o&ugrave; votre demande est particuli&egrave;rement complexe ou si vous en avez fait plusieurs. Dans ce cas, nous vous pr&eacute;viendrons et vous tiendrons inform&eacute;.</p>\r\n\r\n<h3>Article 11 &ndash; Plainte aupr&egrave;s de l&rsquo;Autorit&eacute; de protection des donn&eacute;es</h3>\r\n\r\n<p>Si vous consid&eacute;rez que FREELY LIBERTINAGE ne respecte pas ses obligations au regard de vos Informations Personnelles, vous pouvez adresser une plainte ou une demande aupr&egrave;s de l&rsquo;autorit&eacute; comp&eacute;tente. En France, l&rsquo;autorit&eacute; comp&eacute;tente est la CNIL &agrave; laquelle vous pouvez adresser une demande par voie &eacute;lectronique &agrave; l&rsquo;adresse suivante :&nbsp;<a href=\"https://www.cnil.fr/fr/plaintes/internet\" target=\"_blank\">https://www.cnil.fr/fr/plaintes/internet</a>.</p>\r\n\r\n<h3>Article 12 &ndash; Politique relative aux cookies</h3>\r\n\r\n<p>Lors de votre premi&egrave;re utilisation du Service , vous &ecirc;tes avertis par un bandeau que des informations relatives &agrave; votre navigation sont susceptibles d&rsquo;&ecirc;tre enregistr&eacute;es dans des fichiers alphanum&eacute;riques d&eacute;nomm&eacute;s &laquo; cookies &raquo;. Notre politique d&rsquo;utilisation des cookies vous permet de mieux comprendre les dispositions que nous mettons en &oelig;uvre en mati&egrave;re de navigation sur notre Service. Elle vous informe notamment sur l&rsquo;ensemble des cookies pr&eacute;sents sur notre Service, leur finalit&eacute; et vous donne la marche &agrave; suivre pour les param&eacute;trer.</p>\r\n\r\n<h3>a) Informations g&eacute;n&eacute;rales sur les cookies pr&eacute;sents sur le site</h3>\r\n\r\n<p>FREELY LIBERTINAGE, en tant qu&rsquo;&eacute;diteur du pr&eacute;sent Service, pourra proc&eacute;der &agrave; l&rsquo;implantation de cookies sur le disque dur de votre terminal (ordinateur, tablette, mobile etc.) afin de vous garantir une navigation fluide et optimale sur notre Service.</p>\r\n\r\n<p>Les &laquo; cookies &raquo; (ou t&eacute;moins de connexion) sont des petits fichiers texte de taille limit&eacute;e qui nous permettent de reconna&icirc;tre votre ordinateur, votre tablette ou votre mobile aux fins de personnaliser les services que nous vous proposons.</p>\r\n\r\n<p>Les informations recueillies par le biais des cookies ne permettent en aucune mani&egrave;re de vous identifier nominativement. Elles sont utilis&eacute;es exclusivement pour nos besoins propres afin d&rsquo;am&eacute;liorer l&rsquo;interactivit&eacute; et la performance de notre Service et de vous adresser des contenus adapt&eacute;s &agrave; vos centres d&rsquo;int&eacute;r&ecirc;ts. Aucune de ces informations ne fait l&rsquo;objet d&rsquo;une communication aupr&egrave;s de tiers sauf lorsque FREELY LIBERTINAGE a obtenu au pr&eacute;alable votre consentement ou bien lorsque la divulgation de ces informations est requise par la loi, sur ordre d&rsquo;un tribunal ou toute autorit&eacute; administrative ou judiciaire habilit&eacute;e &agrave; en conna&icirc;tre.</p>\r\n\r\n<p>Pour mieux vous &eacute;clairer sur les informations que les cookies identifient, vous trouverez un tableau listant les diff&eacute;rents types de cookies susceptibles d&rsquo;&ecirc;tre utilis&eacute;s sur le Service de FREELY LIBERTINAGE, leur nom, leur finalit&eacute; ainsi que leur dur&eacute;e de conservation &agrave; l&rsquo;adresse .</p>\r\n\r\n<h3>b) Configuration de vos pr&eacute;f&eacute;rences sur les cookies</h3>\r\n\r\n<p>Vous pouvez accepter ou refuser le d&eacute;p&ocirc;t de cookies &agrave; tout moment.</p>\r\n\r\n<p>Lors de votre premi&egrave;re utilisation du Service , une banni&egrave;re pr&eacute;sentant bri&egrave;vement des informations relatives au d&eacute;p&ocirc;t de cookies et de technologies similaires appara&icirc;t en bas de votre &eacute;cran. Cette banni&egrave;re vous avertit qu&rsquo;en poursuivant votre navigation sur le Service de FREELY LIBERTINAGE (en chargeant une nouvelle page ou en cliquant sur divers &eacute;l&eacute;ments du Service par exemple), vous acceptez le d&eacute;p&ocirc;t de cookies sur votre terminal.</p>\r\n\r\n<p>Selon le type de cookie en cause, le recueil de votre consentement au d&eacute;p&ocirc;t et &agrave; la lecture de cookies sur votre terminal peut &ecirc;tre imp&eacute;ratif.</p>\r\n\r\n<h3>c) Les cookies exempt&eacute;s de consentement</h3>\r\n\r\n<p>Conform&eacute;ment aux recommandations de la Commission Nationale de l&rsquo;Informatique et des Libert&eacute;s (CNIL), certains cookies sont dispens&eacute;s du recueil pr&eacute;alable de votre consentement dans la mesure o&ugrave; ils sont strictement n&eacute;cessaires au fonctionnement du Service ou ont pour finalit&eacute; exclusive de permettre ou faciliter la communication par voie &eacute;lectronique. Il s&rsquo;agit notamment des cookies d&rsquo;identifiant de session, d&rsquo;authentification, de session d&rsquo;&eacute;quilibrage de charge ainsi que des cookies de personnalisation de votre interface. Ces cookies sont int&eacute;gralement soumis &agrave; la pr&eacute;sente politique dans la mesure o&ugrave; ils sont &eacute;mis et g&eacute;r&eacute;s par FREELY LIBERTINAGE</p>\r\n\r\n<h3>d) Les cookies n&eacute;cessitant le recueil pr&eacute;alable de votre consentement</h3>\r\n\r\n<p>Cette exigence concerne les cookies &eacute;mis par des tiers et qui sont qualifi&eacute;s de &laquo; persistants &raquo; dans la mesure o&ugrave; ils demeurent dans votre terminal jusqu&rsquo;&agrave; leur effacement ou leur date d&rsquo;expiration.</p>\r\n\r\n<p>De tels cookies &eacute;tant &eacute;mis par des tiers, leur utilisation et leur d&eacute;p&ocirc;t sont soumis &agrave; leurs propres politiques de confidentialit&eacute; dont vous trouverez un lien ci-dessous. Cette famille de cookie regroupe les cookies de mesure d&rsquo;audience, les cookies publicitaires, auxquels FREELY LIBERTINAGE n&rsquo;a pas recours, ainsi que les cookies de partage de r&eacute;seaux sociaux (Facebook, YouTube, Twitter, LinkedIn, etc.) auxquels FREELY LIBERTINAGE n&rsquo;a pas recours.</p>\r\n\r\n<p>Les cookies de mesure d&rsquo;audience &eacute;tablissent des statistiques concernant la fr&eacute;quentation et l&rsquo;utilisation de divers &eacute;l&eacute;ments du Service (comme les contenus / pages que vous avez visit&eacute;). Ces donn&eacute;es participent &agrave; l&rsquo;am&eacute;lioration de l&rsquo;ergonomie du Service. Sur le Service , un outil de mesure d&rsquo;audience (Google Analytics) est utilis&eacute; ; sa politique de confidentialit&eacute; est disponible en fran&ccedil;ais &agrave; l&rsquo;adresse internet suivante :&nbsp;<a href=\"https://www.google.com/analytics/learn/privacy.html\" target=\"_blank\">https://www.google.com/analytics/learn/privacy.html</a></p>\r\n\r\n<h3>e) Outils de param&eacute;trage des cookies</h3>\r\n\r\n<p>La plupart des navigateurs Internet sont configur&eacute;s par d&eacute;faut de fa&ccedil;on &agrave; ce que le d&eacute;p&ocirc;t de cookies soit autoris&eacute;. Votre navigateur vous offre l&rsquo;opportunit&eacute; de modifier ces param&egrave;tres standards de mani&egrave;re &agrave; ce que l&rsquo;ensemble des cookies soit rejet&eacute; syst&eacute;matiquement ou bien &agrave; ce qu&rsquo;une partie seulement des cookies soit accept&eacute;e ou refus&eacute;e en fonction de leur &eacute;metteur.</p>\r\n\r\n<p>ATTENTION : Nous attirons votre attention sur le fait que le refus du d&eacute;p&ocirc;t de cookies sur votre terminal est n&eacute;anmoins susceptible d&rsquo;alt&eacute;rer votre exp&eacute;rience d&rsquo;utilisateur ainsi que votre acc&egrave;s &agrave; certains services ou fonctionnalit&eacute;s du pr&eacute;sent Service. Le cas &eacute;ch&eacute;ant, FREELY LIBERTINAGE d&eacute;cline toute responsabilit&eacute; concernant les cons&eacute;quences li&eacute;es &agrave; la d&eacute;gradation de vos conditions de navigation qui interviennent en raison de votre choix de refuser, supprimer ou bloquer les cookies n&eacute;cessaires au fonctionnement du Service. Ces cons&eacute;quences ne sauraient constituer un dommage et vous ne pourrez pr&eacute;tendre &agrave; aucune indemnit&eacute; de ce fait.</p>\r\n\r\n<p>Votre navigateur vous permet &eacute;galement de supprimer les cookies existants sur votre terminal ou encore de vous signaler lorsque de nouveaux cookies sont susceptibles d&rsquo;&ecirc;tre d&eacute;pos&eacute;s sur votre terminal. Ces param&eacute;trages n&rsquo;ont pas d&rsquo;incidence sur votre navigation mais vous font perdre tout le b&eacute;n&eacute;fice apport&eacute; par le cookie.</p>\r\n\r\n<p>Veuillez ci-dessous prendre connaissance des multiples outils mis &agrave; votre disposition afin que vous puissiez param&eacute;trer les cookies d&eacute;pos&eacute;s sur votre terminal.</p>\r\n\r\n<h3>f) Param&eacute;trage de votre navigateur internet</h3>\r\n\r\n<p>Chaque navigateur Internet propose ses propres param&egrave;tres de gestion des cookies. Pour savoir de quelle mani&egrave;re modifier vos pr&eacute;f&eacute;rences en mati&egrave;re de cookies, vous trouverez ci-dessous les liens vers l&rsquo;aide n&eacute;cessaire pour acc&eacute;der au menu de votre navigateur pr&eacute;vu &agrave; cet effet.</p>\r\n\r\n<p>Google Chrome :&nbsp;<a href=\"https://support.google.com/chrome/answer/95647?hl=fr\" target=\"_blank\">https://support.google.com/chrome/answer/95647?hl=fr</a><br />\r\nInternet Explorer :&nbsp;<a href=\"https://support.microsoft.com/fr-fr/help/17442/windows-internet-explorer-delete-manage-cookies#ie=ie-11\" target=\"_blank\">https://support.microsoft.com/fr-fr/help/17442/windows-internet-explorer-delete-manage-cookies#ie=ie-11</a><br />\r\nMozilla Firefox :&nbsp;<a href=\"https://support.mozilla.org/fr/kb/activer-desactiver-cookies\" target=\"_blank\">https://support.mozilla.org/fr/kb/activer-desactiver-cookies</a><br />\r\nOpera :&nbsp;<a href=\"http://help.opera.com/Windows/10.20/fr/cookies.html\" target=\"_blank\">http://help.opera.com/Windows/10.20/fr/cookies.html</a><br />\r\nSafari&nbsp;<a href=\"https://support.apple.com/kb/PH21411?viewlocale=fr_FR&amp;locale=fr_FR\" target=\"_blank\">https://support.apple.com/kb/PH21411?viewlocale=fr_FR&amp;locale=fr_FR</a><br />\r\n<br />\r\nPour de plus amples informations concernant les outils de ma&icirc;trise des cookies, vous pouvez consulter le site internet de la CNIL :&nbsp;<a href=\"https://www.cnil.fr/fr/cookies-les-outils-pour-les-maitriser\" target=\"_blank\">https://www.cnil.fr/fr/cookies-les-outils-pour-les-maitriser</a>.</p>\r\n\r\n<p>Pour toute interrogation ou demande compl&eacute;mentaire d&rsquo;informations relative &agrave; la pr&eacute;sente politique des cookies, merci de bien vouloir nous contacter.</p>\r\n\r\n<h3>g) Liste des cookies</h3>\r\n\r\n<p>La liste d&eacute;taill&eacute;e des cookies utilis&eacute;s sur le Service est disponible &agrave; l&rsquo;adresse suivante : .</p>\r\n\r\n<p>Tous droits r&eacute;serv&eacute;s &ndash; 11 mai 2021</p>', 'Mentions légales', '<p>Identification de l&rsquo;&eacute;diteur et de l&rsquo;h&eacute;bergeur du site</p>\r\n\r\n<p>Le site est &eacute;dit&eacute; par FREELY LIBERTINAGE Soci&eacute;t&eacute;, dont le si&egrave;ge social est sis au 6 chemin combe de tourelle, 30111 Cong&eacute;nies .</p>\r\n\r\n<p>N&deg; de TVA intracommunautaire : FR 81 823 666 599.</p>\r\n\r\n<p>Directeur de la publication : FREELY LIBERTINAGE, de FREELY LIBERTINAGE Soci&eacute;t&eacute;l, joignable au ou &agrave; l&rsquo;adresse freelycontact30@gmail.com.</p>\r\n\r\n<p>Le site est h&eacute;berg&eacute; par 1&amp;1 IONOS SARL 7, place de la Gare, BP 70109, 57200 Sarreguemines Cedex. Les informations concernant la collecte et le traitement des donn&eacute;es personnelles (politique et d&eacute;claration) sont fournies dans la charte de donn&eacute;es personnelles du site.</p>\r\n\r\n<p>Tous droits r&eacute;serv&eacute;s &ndash; 11 mai 2021</p>');
